  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset contains detailed information
  on incidents handled by FDNY Fire (non-EMS) units and includes fire, medical and
  non-fire emergencies. The data is collected in the New York Fire Incident Reporting
  System (NYFIRS), which is structured by the FDNY to provide data to the National
  Fire Incident Reporting System (NFIRS).  NFIRS is a modular all-incident reporting
  system designed by the U.S. Fire Administration. After responding to an incident,
  FDNY officers complete one or more of the NFIRS modules, depending upon the type
  of incident. The information in these modules describes the kind of incident responded
  to, where it occurred, the resources used to mitigate it.  Although NFIRS was designed
  specifically to understand the nature and causes of fire, as well as civilian fire
  casualties and firefighter injuries, it has been expanded to collect basic information
  on all incidents to which fire units respond.\",\n\t\"license_title\": \"License
